int ind(int h, int r)
{
  assert(h < height_photo && r < width_photo);
  return h * width_photo + r;
}

typedef uint32_t color_t;
#define RGB_WHITE 0xffffff;

color_t map_xy_pix(int x, int y)
{
  return pix_info[ind(y, x)]; 
}

#define SIDE 16
//in pixel, size of one block

static int w, h;  // Screen size

#define KEYNAME(key) \
  [AM_KEY_##key] = #key,
static const char *key_names[] = { AM_KEYS(KEYNAME) };

static inline void puts(const char *s) {
  for (; *s; s++) putch(*s);
}

void print_key() {
  AM_INPUT_KEYBRD_T event = { .keycode = AM_KEY_NONE }; //X: type of keyboard event
  //X: used as a buffer to receive info from ioe_read

  ioe_read(AM_INPUT_KEYBRD, &event);
  if (event.keycode != AM_KEY_NONE && event.keydown) {
    puts("Key pressed: ");
    puts(key_names[event.keycode]);
    puts("\n");

    //my piece
    if(event.keycode == AM_KEY_ESCAPE)
      halt(0);
    //end my piece
  }
}


//X: color coded by r,g,b
static void draw_tile(int x, int y, int w, int h, uint32_t color) {
  uint32_t pixels[w * h]; // WARNING: large stack-allocated memory

  AM_GPU_FBDRAW_T event = {
    .x = x, .y = y, .w = w, .h = h, .sync = 1,
    .pixels = pixels,
  };

  //paint an area of w*h 
  // with color 
  for (int i = 0; i < w * h; i++) {
    pixels[i] = color;
  }
  ioe_write(AM_GPU_FBDRAW, &event);
}

void splash() {
  //fetch the width and hight of the screen
  //in pix
  AM_GPU_CONFIG_T info = {0};
  ioe_read(AM_GPU_CONFIG, &info);
  w = info.width;
  h = info.height;

  for (int x = 0; x * SIDE <= w; x ++) {
    for (int y = 0; y * SIDE <= h; y++) {
      if ((x & 1) ^ (y & 1)) {
        draw_tile(x * SIDE, y * SIDE, SIDE, SIDE, 0xffffff); // white
      }
    }
  }
  //X: the last argument of draw_tile signify the color
}

static void draw_block(int x, int y, int with_block, int height_block) {
  uint32_t pixels[with_block * height_block]; // WARNING: large stack-allocated memory

  AM_GPU_FBDRAW_T event = {
    .x = x, .y = y, .w = with_block, .h = height_block, .sync = 1,
    .pixels = pixels,
  };

  //paint an area of w*h 
  // with color 
  for (int dx = 0; dx < with_block; dx++) 
  {
    for(int dy = 0; dy < height_block; dy++)
    {
      int x_pho = x+dx, y_pho = y+dy;
      if(x_pho >= w || y_pho >= h)   
      {
        pixels[dx*h+dy] = 0xffffff;
        continue;
      }  
      pixels[dx*h+dy] = map_xy_pix(x_pho, y_pho);
    }
  }
  ioe_write(AM_GPU_FBDRAW, &event);
}
